	// shadertoy
	
	const apply_toy = async object =>{
		if ( 'material' in object ){
			
			const images      = [ 
				'data:image/jpg;base64,' ,
				'data:image/jpg;base64,' ,
				'data:image/jpg;base64,' ,
				'data:image/jpg;base64,' ,
				'data:image/jpg;base64,' ,
				'data:image/jpg;base64,' ,
			]			
			let cube_images = []
			let cube_texture
			images . forEach ( async base64 => {
				const image = new Image ()
				image       . src   = base64
				await       image . decode    ()
				cube_images . push      ( image )
				
				if ( cube_images . length == images . length ) {
					cube_texture = new THREE . CubeTexture ( cube_images )
					cube_texture . needsUpdate = true		
				}
			} )
			
			const grey_noise_medium_image = new Image ()
			grey_noise_medium_image.onload = event =>{
				const grey_noise_medium_texture = new THREE.CanvasTexture ( grey_noise_medium_image )
				
				let src = 'uniform float       iTime ;\n' + 
				          'uniform vec2        iResolution;\n' + 
				          'uniform sampler2D   iChannel3;\n' + 
				          'uniform vec4        iMouse;\n' + 
				          'uniform samplerCube iChannel0;\n' + 
						  'uniform int         iFrame ;\n' + 
						  object.userData.toy_src
				const mainImage_index = src.indexOf ( 'mainImage' )
				if ( mainImage_index < 0 ) {
					alert ( 'Error #1 : no mainImage !' )
					return
				}
				const prev = src.slice ( 0 , mainImage_index ) + 'main ()'
				let   post = src.slice ( mainImage_index )
				const closing_parenthesis_index = post.indexOf ( ')' )
				if ( closing_parenthesis_index < 0 ) {
					alert ( 'Error #2 : no ")" !' )
					return
				}
				let   mainImage_definition = post.slice ( 0 , closing_parenthesis_index + 1 )
				post = post.slice ( closing_parenthesis_index + 1 )
				
				mainImage_definition        = mainImage_definition.replace ( '(' , ' ' );
				mainImage_definition        = mainImage_definition.replace ( ',', ' ' );
				mainImage_definition        = mainImage_definition.replace ( ')', ' ' );
				const mainImage_definitions = mainImage_definition.split   ( ' ' )
				
				const clean_mainImage_definitions = []
				for ( const definition of mainImage_definitions )
					if ( definition != '' ) clean_mainImage_definitions.push ( definition )
				
				const fragColor             = clean_mainImage_definitions [ 3 ]
				const fragCoord             = clean_mainImage_definitions [ clean_mainImage_definitions.length - 1 ]
				eval ( 'post = post.replace ( /' + fragColor + '/g, "gl_FragColor" )' );
				eval ( 'post = post.replace ( /' + fragCoord + '/g, "gl_FragCoord" )' );
			
				src = prev + post;
				const shader_material = new THREE.ShaderMaterial ({
					uniforms       : { 
						itime       : { value : 0 } ,
						iResolution : { value : { x : innerWidth   , y : innerHeight }} ,
						iMouse      : { value : { x : innerWidth , y : innerHeight * .675, z : 0 }} ,
						iChannel3   : { value : grey_noise_medium_texture } ,
						iChannel1   : { value : grey_noise_medium_texture } ,
						iChannel2   : { value : grey_noise_medium_texture } ,
						iChannel0   : { value : cube_texture } ,
					} ,
					vertexShader   : `
						uniform vec3 u_camera_position   ;

						varying vec2 vUV                 ;
						varying vec3 vOrigin             ;
						varying vec3 vDirection          ;
						
						varying mat4  v_modelViewMatrix  ;
						varying mat4  v_projectionMatrix ;			
													
						void main() {
							vUV                = uv ;
							
							v_modelViewMatrix  = modelViewMatrix  ;
							v_projectionMatrix = projectionMatrix ;
							
							vOrigin            = vec3 ( inverse ( modelMatrix ) * vec4 ( u_camera_position , 1.0 ) ) . xyz ;
							vDirection         = position - vOrigin ;
							vec4 mvPosition    = modelViewMatrix * vec4 ( position , 1.0 ) ;
							gl_Position        = projectionMatrix * mvPosition ;
						}					
					` ,//`void main (){ gl_Position = projectionMatrix * modelViewMatrix * vec4( position, 1.0 ); }` ,
					fragmentShader : src ,
				})
				
				object.material = shader_material
				//setInterval ( ()=> object.material.uniforms.iTime = { value : performance.now () / 1000 })
			}
			grey_noise_medium_image.src = 'data:image/png;base64,'
		} else alert ( 'Shaders must be applied to mesh nodes !' )
	}

